    A, B = [int(n) for n in stdin.strip().split()]

    def f(button: int) -> int:
        """
        :param button: The size of the button, which cannot decrease.
        :return: The maximum number of coins you can get if you press the button `button` twice.
        """
        if button == 1:
            return button + 1
        if button == 2:
            return button * 2
        return button + f(button - 1) + f(button - 2)

    return str(max(f(A) - A, f(B) - B, f(A) + f(B)))

