    q = []
    for i in range(N):
        for j in range(M):
            q.append([i, j, 0])

    # Set the first item in the queue
    q[0][2] = 1
    for i in range(N):
        for j in range(M):
            if burned_grid[i][j] == '0':
                burned_grid[i][j] = '2'

    # Add burning houses to the queue
    for i in range(N):
        burned_grid[i].insert(0, '2')
        burned_grid[i].append('2')

    while t > 0:
        # Check each cell in the queue
        while len(q) > 0:
            # Grab the cell
            [i, j, k] = q.pop(0)

            # Check the cell's neighbors
            if j - 1 >= 0:
                # Check the left neighbor
                if burned_grid[i][j-1] == '0' and k < 2:
                    q.append([i, j-1, k+1])
                    burned_grid[i][j-1] = '2'
            if j + 1 < M:
                # Check the right neighbor
