                    q.append([i, j+1, k+1])
                    burned_grid[i][j+1] = '2'
            if i - 1 >= 0:
                # Check the upper neighbor
                if burned_grid[i-1][j] == '0' and k < 2:
                    q.append([i-1, j, k+1])
                    burned_grid[i-1][j] = '2'
            if i + 1 < N:
                # Check the lower neighbor
                if burned_grid[i+1][j] == '0' and k < 2:
                    q.append([i+1, j, k+1])
                    burned_grid[i+1][j] = '2'
            # Check the current cell
            if i == stdin_location and k < 1:
                # Check the current cell
                q.append([i, j, k+1])
                burned_grid[i][j] = '2'
            # Decrement the time
            t -= 1

